                component={FirstSetting} 
                isLoggedIn={this.state.isLoggedIn}/> 

              {/* <Route component={() => <div className="display-2"><strong>404 NOT FOUND</strong></div>}/> */}
           </Switch>

           </div>

   );
    }
}



